import Link from 'next/link';

const linkStyle = {
  marginRight: 500,
};
function MyImage() {
  return <img src="/logo.jpg" alt="logo" />
}
const Header = () => (
  <div>

    <h2>LETIŠTĚ CHRAST</h2>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
  
   
);

export default  MyImage;
